a 1: Cual es el equipo con mejor defensa en 1 temporada\n","# Pregunta 2: Cual es el equipo historicamente defiende mejor\n","# Pregunta 3: La mejor defensa siempre llega play off??\n","\n","ubicaci_team_total <- \"/kaggle/input/nba-aba-baa-stats/Team Totals.csv\"\n","team_total <- read.csv(ubicaci_team_total)\n","stats_defensa <- c(1,2,4,5,6,20,21,22,24,25,27,28)\n","defensa <- team_total[,stats_defensa]\n","\n","#normalizando diviDIendo entre la cantidad de partidos\n","defensa$pts <- defensa$pts/defensa$g\n","defensa$drb <- defensa$drb/defensa$g\n","defensa$stl <- defensa$stl/defensa$g\n","defensa$blk <- defensa$blk/defensa$g\n","\n","str(defensa)\n","head(defensa)\n","\n","defensa_anual <- as.data.frame(defensa %>% \n","                 filter(lg==\"NBA\", season>=1974) %>%\n","                 group_by(season) %>%\n","                 summarise(total_points=sum(pts,na.rm = TRUE), total_drb=sum(drb,na.rm = TRUE),total_blk=sum(blk,na.rm = TRUE),total_stl=sum(stl,na.rm = TRUE)))\n","\n","head(defensa_anual)\n","str(defensa_anual)\n","\n","\n","\n","regresion_points_season <- lm(defensa_anual$total_points ~ defensa_anual$season)\n","plot(defensa_anual$season,defensa_anual$total_points) \n","abline(regresion_points_season, col=\"red\")\n","# Conclusión 1: Los puntos en la NBA están creciendo año tras año, es posible que las defensas ya no tengan tanto impacto en la ofensiva.\n","\n","regresion_drb_season <- lm(defensa_anual$total_drb ~ defensa_anual$season)\n","plot(defensa_anual$season,defensa_anual$total_drb)\n","abline(regresion_drb_season, col=\"yellow\")\n","# Conclusión 2: Los rebotes defensivos tambien crecen año tras año, pero no parecen tener impacto en los puntos.\n","\n","regresion_blk_season <- lm(defensa_anual$total_blk ~ defensa_anual$season)\n","plot(defensa_anual$season,defensa_anual$total_blk) \n","abline(regresion_blk_season, col=\"green\")\n","# Conclusion 3: Los bloqueos parecen mantenerse constantes año tras años.\n","\n","regresion_stl_season <- lm(defensa_anual$total_stl ~ defensa_anual$season)\n","plot(defensa_anual$season,defensa_anual$total_stl) \n","abline(regresion_stl_season, col=\"blue\")\n","# Conclusion 4: Los robos no parecen tener tendencia alguna.\n","\n","#Analisis de componentes principales para reducir las varibles de defensa rebote defensico, bloqueos y robos\n","rownames(defensa_anual) <- defensa_anual$season\n","pca_result <- prcomp(defensa_anual[,3:5],center= TRUE, scale. = TRUE)\n","pca_result$rotation\n","summary(pca_result)\n","\n","pc1 <- apply(pca_result$rotation[,1]*defensa_anual[,3:5],1,sum)\n","\n","defensa_anual$pc1 <- pc1\n","defensa_anual$rendimiento <- defensa_anual$total_points / defensa_anual$pc1\n","head(defensa_anual)\n","\n","#Presentación final puntos por jornada completa (todos los equipos) vs pc1 (indicador defensa)\n","plot(defensa_anual$pc1,defensa_anual$total_points)\n","text(defensa_anual$pc1, defensa_anual$total_points, labels=defensa_anual$season, pos = 1, col = \"red\")\n","\n","plot(defensa_anual$season,defensa_anual$rendimiento,type=\"l\")\n","plot(defensa_anual$season,defensa_anual$pc1,type=\"l\")\n","#Conclusión,05: El indicador de defensa viene creciendo constantemente todos los años. \n","#Conclusión 06: El rendimiento del indicador de defensa, sube y baja. \n","#Esto se refiere que a pesar que el el indicador de defensa crece, no logra evitar que se anoten menos puntos. Sobre todo en la última decada.\n","#Conclusión 07: En los ultimos 10 años la ofensiva esta superando claramente a la defensa, a pesar del crecimiento de esta ultima.\n"]}],"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"pap